import React from 'react';
import MetaNavigator from './components/MetaNavigator';

/**
 * Root Application Entry
 * Loads MetaNavigator interface with all 3D ritual, chakra, grid, and dashboard logic
 */
function App() {
  return (
    <main style={{ backgroundColor: '#000', minHeight: '100vh', color: '#fff' }}>
      <React.Suspense fallback={<div>Loading Ritual Interface...</div>}>
        <MetaNavigator />
      </React.Suspense>
    </main>
  );
}

export default App;
